import React, {Component} from 'react';

function Tags(props){
  var output = document.createElement("p");
  for(let i=0; i<props.tags.length; i++){
    output.innerHTML+=props.tags[i];
    output.innerHTML+=" ";
  }
  return(
    output
  )
}

export default Tags
